import React from 'react'
import Logo from '../images/WordPress_blue_logo.svg.png'
const Footer = () => {
  return (
    <footer>
        <img src={Logo}alt="Logo" />
        <span>Made by watching a tutorial</span>
        
    </footer>
  )
}

export default Footer
